    @SuppressWarnings("unchecked")
    @Override
    public <T> TypeAdapter<T> create(Gson gson, TypeToken<T> type) {
       if (!FileSystem.class.isAssignableFrom(type.getRawType())) {
         return null; // this class only serializes 'FileSystem' and its subtypes
       }
       final TypeAdapter<JsonElement> elementAdapter = gson.getAdapter(JsonElement.class);
       final TypeAdapter<FileSystem> thisAdapter
                        = gson.getDelegateAdapter(this, TypeToken.get(FileSystem.class));

       return (TypeAdapter<T>) new TypeAdapter<FileSystem>() {
           @Override
           public void write(JsonWriter out, FileSystem value) throws IOException {
             JsonObject obj = thisAdapter.toJsonTree(value).getAsJsonObject();
             elementAdapter.write(out, obj);
           }

           @Override
           public FileSystem read(JsonReader in) throws IOException {
             JsonElement jsonElement = elementAdapter.read(in);
             validateJsonElement(jsonElement);
             return thisAdapter.fromJsonTree(jsonElement);
           }

       }.nullSafe();
    }
